1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Maintain fulltime employment, schooling or combination;
3) Pay court costs;
4) pay supervision fees in an amount to be determined by DOC;
5) maintain absolute sobriety;
6) Defendant is to use only one doctor and one pharmacy;
7) Pay restitution as follows:  $871.71 to Community First Credit Union and $120.00 to Angela Jones.
